DROP TABLE IF EXISTS `mod_multi_class_spells`;
CREATE TABLE `mod_multi_class_spells` (
	`SpellID` MEDIUMINT(7) NOT NULL,
	`SpellName` VARCHAR(80) NOT NULL,
	`SpellSubText` VARCHAR(10) NOT NULL,
	`ReqSpellID` MEDIUMINT(7) NOT NULL,
	`ReqLevel` TINYINT(3) NOT NULL,
	`Class` TINYINT(3) NOT NULL,
	`Side` VARCHAR(10) NOT NULL,
	`IsTalent` TINYINT(3) NOT NULL,
	`IsLearnedByTalent` TINYINT(3) NOT NULL
);

